import styles from "./Product.module.css";

import { shorten } from "../../helpers/functions";

const Product = ({ product }) => {
    return (
        <>
            <div className="p-2">
                <div className="p-3 shadow rounded-3">
                    <img src={product.image} alt={product.title} />
                </div>
            </div>
        </>
    )
}

export default Product;
